// App.js
import React, { useState } from 'react';
import axios from 'axios';
import DateInput from './DateInput';
import ChangeList from './ChangeList';

const App = () => {
  const [changes, setChanges] = useState([]);

  const fetchChanges = (date1, date2) => {
    axios.get(`http://localhost:8001/getChanges/${date1}/${date2}`)
      .then(response => setChanges(response.data))
      .catch(error => console.error('Error fetching changes:', error));
  };

  return (
    <div className="App">
      <h2>Change Tracker</h2>
      <DateInput onFetchChanges={fetchChanges} />
      <ChangeList changes={changes} />
    </div>
  );
};

export default App;
